import React from 'react';
import {Typography, Avatar, Grid, Box} from '@material-ui/core';
import avatar from './img/robbie.png'


const About = () => {
    return (
        <Box>
            <Avatar src={avatar} alt="Robbie"/>
        </Box>
    )
}

export default About;
